  false,\n\t\"url\": null,\n\t\"notes\": \"The Congress passed, and the President
  signed into law, legislation establishing the San Francisco Bay National Wildlife
  Refuge. When the purchase of property for the refuge has been completed, some 22,000
  acres of open water, marshlands, and salt ponds at the south end of San Francisco
  Bay will have been turned into one of the nation's most unusual wildlife sanctuaries.
  Not only will it provide essential habitat for varied and abundant wildfowl, but
  as a wildlife refuge in the midst of a densely-populated urban area, it will provide
  close-to-home opportunities for public enjoyment, nature study, and scientific research.
  The creation of the wildlife refuge in the South Bay, together with establishment
  of the less-well-known but also important San Pablo Bay National Wildlife Refuge,
  represent significant accomplishments in protecting the nation's dwindling wildlife
  areas.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
